import React from 'react';
import { Link } from 'react-router-dom';

export default function Card({name, image, type}){
    return(
        <div>
            <Link to='/recipes'>
            <h3>{name}</h3>
            </Link>
            <h5>{type}</h5>
            <img src={image} alt="Image not found" width="200px" height="250px"/>
        </div>

    );
}
